import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from "./Components/Home";
import Gallery from "./Components/Gallery";
import Settings from "./Components/Settings";
import LeftBar from "./Components/AlwaysActive/LeftBar";
import TopBar from './Components/AlwaysActive/TopBar';
import { StyleSheet, View } from 'react-native';

function App() {
    return (
        <Router>
            <div className="Kinsky-Frontend">
                <View style={stylesContainers.containerRow}>
                    <LeftBar />

                    <View style={stylesContainers.containerColumn}>
                        <TopBar />
                        <View style={stylesContainers.content}>
                            <Switch>
                                <Route path="/" exact component={Home} />
                                <Route path="/gallery" component={Gallery} />
                                <Route path="/settings" component={Settings} />
                            </Switch>
                        </View>
                    </View>
                </View>
            </div>
        </Router>
    );
}

const stylesContainers = StyleSheet.create({
    containerRow: {
        flexDirection: "row",
        height: '100vh',
    },
    containerColumn: {
        flexDirection: "column",
        flex: 1,
    },
    content: {
        flex: 1,
        padding: 10,
    },
});

export default App;
